import React, {Component} from "react"

class Form extends Component {
    constructor() {
        super()
        this.state = {
            Gender: ""
        }
        this.clickHandler = this.clickHandler.bind(this)
    }

    clickHandler(event) {
        Gender: event
    }


    render() {
        return (
            <form>
                <label>How do you identify yourself: </label>
                <button onClick={this.clickHandler}>Man</button>
            </form>
        )
    }
}

export default Form
